    hover_fg = "black"
    master_color = None
    bod= 1
    bdcolor= "#a0a0a0"
    bdacolor="#7ba2c6"
    padding = 3
    isReadonly = False
    Readme = ""
    Drop = False
    val = []
    var = []
    #drop = Frame()
    m = None



        
    def __op(self, event):
        try:
            self.one.yview_scroll(-1*(event.delta//120), "units")
        except:
            pass

    def __ip(self, event):
        
        pass
        
    
    def __mousechanger(self, event):
        self.drop.bind_all("<MouseWheel>", self.__op)
        
    
    def __mousechanger1(self, event):
        self.drop.bind_all("<MouseWheel>", self.__ip)
        
        
   
    def __bb8(self, event):
        self.one.itemconfig('frame' , width = self.one.winfo_width())
        
    def __repositioner(self ):
        if self.m.winfo_height()-(self.winfo_rooty()-(self.m.winfo_rooty()))<200:
            self.drop.place(x = self.winfo_rootx()-self.m.winfo_rootx() , y =(int(self.winfo_rooty()-self.m.winfo_rooty()))-203)

        else:
            self.drop.place(x = self.winfo_rootx()-self.m.winfo_rootx() , y =(int(self.winfo_rooty()-self.m.winfo_rooty()))+self.winfo_height()-3)

        self.drop.after(100, self.__repositioner)

    
    def __com(self, inn):
        
        #print(len(self.var), inn)
        text = self.var[int(inn)]
        text = text.button['text']

        self.textbox.delete(0, END)
        self.textbox.insert(1, text)

        try:
            self.drop.destroy()

            self.Drop  = False
            self.one.destroy()
        except:pass


    def __drop(self):
        if not self.Drop:
            self.textbox.update()
            self.update()

            import functools
            from functools import partial
            
            self.drop = tk.Frame(self.m, bg= self.get_bg)
            m = self.winfo_width()
            self.one = tk.Canvas(self.drop , bg= self.get_bg, width = m, height = 200, highlightthickness = 0)
            self.one.pack(fill = BOTH, anchor = "nw", side = LEFT)

            self.drop1 = Frame(self.one, bg= self.get_bg , )
            self.drop1.bind("<Configure>", lambda a:self.one.configure(scrollregion = self.one.bbox("all")))
            self.one.create_window((0,0),window = self.drop1, anchor = "nw", tag = "frame")
            values = self.val
            
            
            self.drop.config(width = m)
            
            #print(m)

            self.var = []
            x  = 0 
            for i in values:
                ooo =x
                
                s = Button(self.drop1, bg= self.get_bg,font=self.textbox['font']
                    , fg = self.get_fg,text = i, bdcolor = self.get_bg ,bd = 2, anchor = "w"
                    , command = partial(self.__com, ooo ))
                s.pack(fill = BOTH, pady = 0, expand = 1)
                x+=1

                self.var.append(s)


            
            

           
            
            self.Drop = True
            self.one.bind("<Configure>", self.__bb8)

            
            if self.m.winfo_height()-(self.winfo_rooty()-(self.m.winfo_rooty()))<200:
                self.drop.place(x = self.winfo_rootx()-self.m.winfo_rootx() , y =(int(self.winfo_rooty()-self.m.winfo_rooty()))-203)

            else:
                self.drop.place(x = self.winfo_rootx()-self.m.winfo_rootx() , y =(int(self.winfo_rooty()-self.m.winfo_rooty()))+self.winfo_height()-3)



            self.drop.update()
            
            try:
                self.drop1.update()
                #print(self.drop1.winfo_height()) ###Testing if the value is right
                if self.drop1.winfo_height()> 200:

                    self.one.update()

                    s = self.one.winfo_width()
                    
                    self.src = Scrollbar(self.drop , command = self.one.yview)
                    self.src.pack(anchor = "e", fill = Y, side = RIGHT)
                    self.one.configure(yscrollcommand = self.src.set )
                    
                    #self.drop1.bind("<Configure>", lambda a:self.one.configure(scrollregion = self.drop1.bbox("all")))
                    self.src.update()
                    self.one.configure(width = s-self.src.winfo_width())
            except:pass

            self.drop.after(100, self.__repositioner)
            self.drop.bind("<Enter>", self.__mousechanger)
            self.one.bind("<Leave>", self.__mousechanger1)
            
            
        else:
            self.drop.destroy()
            self.Drop  = False

            #self.drop  = Frame(self.)
        
